-- ----------------------------
-- Table structure for t_attachment
-- ----------------------------
DROP TABLE IF EXISTS `t_attachment`;
CREATE TABLE `t_attachment` (
  `id` varchar(50) NOT NULL COMMENT 'id主键',
  `orgTypePathKey` varchar(20) NOT NULL DEFAULT 'kjj' COMMENT 'URL路径中的部门类型,例如 URL路径中的 kjj ',
  `businessId` varchar(50) DEFAULT NULL COMMENT '业务ID,用于业务关联查询',
  `businessModule` varchar(50) DEFAULT NULL COMMENT '业务模块名称',
  `fileName` varchar(500) DEFAULT NULL COMMENT '附件名称',
  `fileURL` varchar(2000) DEFAULT NULL COMMENT '路径',
  `suffix` varchar(500) DEFAULT NULL COMMENT '文件后缀',
  `fileSize` int(11) NOT NULL COMMENT '文件大小,单位K',
  `createTime` datetime NOT NULL COMMENT '专业开始时间',
  `lastDownTime` datetime DEFAULT NULL COMMENT '最后下载时间',
  `sortno` int(11) NOT NULL DEFAULT '0' COMMENT '排序,查询时倒叙排列',
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效(0否,1是)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='专家专业 信息表';

