DROP TABLE IF EXISTS `t_menu`;
CREATE TABLE `t_menu` (
  `id` varchar(50) NOT NULL,
  `name` varchar(500) NOT NULL COMMENT '菜单名称',
  `comcode` varchar(1000) NOT NULL COMMENT '路径代码,用于标识菜单路径,例如 pid是根目录root,此菜单的comcode是  ,root,mymenuid,',
  `pid` varchar(50) NOT NULL COMMENT '父级ID',
