  `hrefurl` varchar(3000) DEFAULT NULL COMMENT '跳转地址',
  `menu_type` int(11) NOT NULL COMMENT '0.功能按钮,1.导航菜单,2.导航目录',
  `icon` varchar(100) DEFAULT NULL COMMENT '图标样式',
  `sortno` int(11) NOT NULL DEFAULT '0' COMMENT '排序,查询时倒叙排列',
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效(0否,1是)',
  `has_child` int(11) NOT NULL DEFAULT '0' COMMENT '是否有子菜单-0：没有，1：有',
  `permission_key` varchar(128) DEFAULT NULL COMMENT '权限标识',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='菜单,根目录id是root';

