-- ----------------------------
-- Table structure for t_oauth_client_details
-- ----------------------------
DROP TABLE IF EXISTS `t_oauth_client_details`;
CREATE TABLE `t_oauth_client_details` (
  `id` varchar(50) NOT NULL,
  `client_id` varchar(50) DEFAULT NULL,
  `client_secret` varchar(1024) DEFAULT NULL COMMENT '应用密钥(密文)',
  `client_secret_str` varchar(1024) DEFAULT NULL COMMENT '应用密钥(明文)',
  `resource_ids` varchar(50) DEFAULT NULL,
  `scope` varchar(11) DEFAULT NULL,
  `authorized_grant_types` varchar(256) DEFAULT NULL,
  `web_server_redirect_uri` varchar(256) DEFAULT NULL,
  `authorities` varchar(256) DEFAULT NULL,
  `access_token_validity` varchar(256) DEFAULT NULL,
  `refresh_token_validity` varchar(256) DEFAULT NULL,
  `additional_information` varchar(256) DEFAULT NULL,
  `autoapprove` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

