-- ----------------------------
-- Table structure for t_org
-- ----------------------------
DROP TABLE IF EXISTS `t_org`;
CREATE TABLE `t_org` (
  `id` varchar(50) NOT NULL COMMENT '编号',
  `name` varchar(60) NOT NULL COMMENT '名称',
  `create_time` varchar(50) NOT NULL,
  `org_type` int(11) NOT NULL COMMENT '0科技局,1注册企业,9虚拟部门',
  `sortno` int(11) DEFAULT '1' COMMENT '排序,查询时倒叙排列',
  `comcode` varchar(1000) NOT NULL COMMENT '路径代码,用于标识部门路径,例如 pid是root,此部门的comcode是  ,root,myorgid,',
  `org_type_path_key` varchar(255) DEFAULT NULL COMMENT 'URL路径中的部门类型,例如 URL路径中的 kjj',
  `update_time` varchar(50) DEFAULT NULL,
  `remark` varchar(2000) DEFAULT NULL COMMENT '备注',
  `pid` varchar(50) NOT NULL COMMENT '上级部门ID',
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效(0否,1是)',
  `update_user_id` varchar(50) DEFAULT NULL,
  `create_user_id` varchar(50) DEFAULT NULL,
  `bak1` varchar(255) DEFAULT NULL COMMENT '预留字段',
  `bak2` varchar(255) DEFAULT NULL COMMENT '预留字段',
  `bak3` varchar(255) DEFAULT NULL COMMENT '预留字段',
  `bak4` varchar(255) DEFAULT NULL COMMENT '预留字段',
  `bak5` varchar(255) DEFAULT NULL COMMENT '预留字段',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='部门';

