-- ----------------------------
-- Table structure for t_org_enterprise
-- ----------------------------
DROP TABLE IF EXISTS `t_org_enterprise`;
CREATE TABLE `t_org_enterprise` (
  `id` varchar(50) NOT NULL COMMENT 'id主键,和orgId保持一致',
  `orgTypePathKey` varchar(20) NOT NULL DEFAULT 'kjj' COMMENT 'URL路径中的部门类型,例如 URL路径中的 kjj ',
  `name` varchar(200) DEFAULT NULL COMMENT '企业名称,和从t_org的name字段同步过来,和营业执照保持一致',
  `contactAddress` varchar(1000) NOT NULL COMMENT '联系地址',
  `contactPersonName` varchar(50) NOT NULL COMMENT '联系人姓名',
  `contactPhone` varchar(50) NOT NULL COMMENT '联系电话',
  `contactEmail` varchar(100) NOT NULL COMMENT '联系邮箱',
  `bType` varchar(100) NOT NULL COMMENT '营业执照类型,例如:有限责任',
  `bAddress` varchar(100) NOT NULL COMMENT '营业执照注册地',
  `bLegalPerson` varchar(100) NOT NULL COMMENT '注册法人',
  `bCapital` varchar(100) NOT NULL COMMENT '注册资本',
  `bCreateTime` date NOT NULL COMMENT '成立日期',
  `bTermStart` date NOT NULL COMMENT '营业期限开始时间',
  `bTermEnd` date NOT NULL COMMENT '营业期限结束时间',
  `bScope` text NOT NULL COMMENT '经营范围',
  `sortno` int(11) NOT NULL DEFAULT '0' COMMENT '排序,查询时倒叙排列',
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效(0否,1是)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=' 企业信息表,企业实际是t_org部门,orgType=1.给部门创建一个账号,作为主管,用于登录.附件关联附件表t_attachment';

