-- ----------------------------
-- Table structure for t_role
-- ----------------------------
DROP TABLE IF EXISTS `t_role`;
CREATE TABLE `t_role` (
  `id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '角色ID',
  `name` varchar(60) NOT NULL COMMENT '角色名称',
  `code` varchar(255) DEFAULT NULL COMMENT '权限编码',
  `private_org` int(11) NOT NULL DEFAULT '0' COMMENT '角色的部门是否私有,0否,1是,默认0.当角色私有时,菜单只使用此角色的部门权限,不再扩散到全局角色权限,用于设置特殊的菜单权限.公共权限时部门主管有所管理部门的数据全权限,无论角色是否分配. 私有部门权限时,严格按照配置的数据执行,部门主管可能没有部门权限.',
  `role_org_type` int(11) NOT NULL DEFAULT '0' COMMENT '0自己的数据,1所在部门,2所在部门及子部门数据,3.自定义部门数据,4全部权限',
  `org_id` varchar(50) NOT NULL COMMENT '角色的归属部门,只有归属部门的主管和上级主管才可以管理角色,其他人员只能增加归属到角色的人员.不能选择部门或则其他操作,只能添加人员,不然存在提权风险,例如 员工角色下有1000人, 如果给 角色 设置了部门,那这1000人都起效了.',
  `share_role` int(11) NOT NULL DEFAULT '0' COMMENT '角色是否共享,0否 1是,默认0,共享的角色可以被下级部门直接使用,但是下级只能添加人员,不能设置其他属性.共享的角色一般只设置roleOrgType,并不设定部门.',
  `sortno` int(11) NOT NULL DEFAULT '0' COMMENT '排序,查询时倒叙排列',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效(0否,1是)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='角色';

