CREATE TABLE `t_user_expert` (
  `id` varchar(50) NOT NULL COMMENT 'id主键,和t_user的ID保持一致',
  `orgTypePathKey` varchar(20) NOT NULL DEFAULT 'kjj' COMMENT 'URL路径中的部门类型,例如 URL路径中的 kjj ',
  `name` varchar(200) NOT NULL COMMENT '专家名称,和从t_user的name字段同步过来',
  `mobile` varchar(16) NOT NULL COMMENT '手机号码',
  `unitName` varchar(200) DEFAULT NULL COMMENT '单位名称',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '注册状态,0资料保存未提交,1资料已提交,2内部审核中,3驳回,4申请成功',
  `sortno` int(11) NOT NULL DEFAULT '0' COMMENT '排序,查询时倒叙排列',
  `active` int(11) NOT NULL DEFAULT '1' COMMENT '是否有效(0否,1是)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='专家信息表,是t_user表的扩展表,userType=3';

